import { Link } from "react-router-dom"

const PRODUCTS = [
    {id: 1, title: 'Product-1'},
    {id: 2, title: 'Product-2'},
    {id: 3, title: 'Product-3'}
]

export default function Products(){

    return (
        <ul>
            {PRODUCTS.map((prod) => {
                return (<li>
                    <Link to={`/products/${prod.id}`}></Link>
                </li>)
            })}
        </ul>
    )
}
